import React from 'react'

function Stats(props) {
    console.log(props);

    const confirmed = props.confirmed.map(location =>
    <div>
        <p>{location.country}</p>
        <p>{location.latest}</p>
    </div>)

    return (
        <div>
            {confirmed}
        </div>
    )
}

export default  Stats
